%devo minimizzare questa funzione   
f=@(L) sum((K-A([L(1:M)])).^2);
%%
if length(initial_guess)==1
init=zeros(M,1)+0.5;
else
    init=initial_guess;
end
    
options = optimset('PlotFcns',@optimplotfval);
[sol,fval]=fminsearch(f,init);%,options)

while fval>stop_cond
    oldfval=fval;
    [sol,fval]=fminsearch(f,sol);
    if abs(oldfval-fval)<diff_cond
        break
    end
end





